const autoCompletion = mixedHTTP.data.of({
    autocomplete: autoComplete
});
function autoComplete(context) {
    const { state } = context;
    const nodeBefore = language.syntaxTree(state).resolveInner(context.pos, -1);
    const from = nodeBefore.from;
    const pos = state.selection.main.head;
    switch (nodeBefore.name) {
        case "InvalidMethod":
            return { from: from, to: pos, options: Methods };
        case "HeaderName":
            return { from: from, to: pos, options: Headers };
    }
}
function http() {
    return new language.LanguageSupport(mixedHTTP, [autoCompletion]);
}

